import React from 'react';

const QualityAssurance = () => {
  const styles = {
    qualityAssurance: {
      textAlign: 'center',
      padding: '20px',
      backgroundColor: '#f9f9f9',
      border: '1px solid #ddd',
      borderRadius: '8px',
      maxWidth: '600px',
      margin: '0 auto',
    },
    heading: {
      fontSize: '24px',
      color: '#333',
      marginBottom: '20px',
    },
    paragraph: {
      fontSize: '16px',
      color: '#666',
      lineHeight: '1.6',
      marginBottom: '20px',
    },
    readMoreLink: {
      display: 'inline-block',
      padding: '10px 20px',
      backgroundColor: '#007bff',
      color: '#fff',
      textDecoration: 'none',
      borderRadius: '5px',
      fontSize: '16px',
    },
    readMoreLinkHover: {
      backgroundColor: '#0056b3',
    },
  };

  return (
    <div style={styles.qualityAssurance}>
      <h1 style={styles.heading}>QUALITY ASSURANCE</h1>
      <p style={styles.paragraph}>
        We are committed to meeting the needs of our customers, staff and stakeholders to ensure that services are carried out to client satisfaction and maintain the integrity and sustainability of the environment.
      </p>
      <a href="/read-more" style={styles.readMoreLink} onMouseOver={(e) => e.currentTarget.style.backgroundColor = styles.readMoreLinkHover.backgroundColor} onMouseOut={(e) => e.currentTarget.style.backgroundColor = styles.readMoreLink.backgroundColor}>
        Read More
      </a>
    </div>
  );
};

export default QualityAssurance;
